import React, { Component } from 'react';

class Signin extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(<form>
            <label>Nom </label><input type = "text"></input><br/>
            <label>Prenom </label><input type = "text"></input><br/>
            <label>Pseudo </label><input type = "text"></input><br/>
            <label>Adresse Mail </label><input type = "email"></input><br/>
            <label>Mot de Passe </label><input type = "password"></input><br/>
            <button type = "button">Inscription</button>

            <Utilisateur login={this.getConnected} logout={this.setLogout} 
            isConnected={this.state.connexion} />
        </form>)
    }
}

export default Signin;
